import React, { Component } from 'react';

class Header extends Component {

    render() { 

        var headerStyle = {
            position: 'fixed',
            textAlign: 'center',
            backgroundColor: '#d1d1d1'
          }

        return (<header className="App-header" style={headerStyle}><h1>Liftility</h1></header>);
    }
}
 
export default Header;
